  true,\n\t\"url\": null,\n\t\"notes\": \"The National Geothermal Data System (NGDS)
  is a catalog of documents and datasets that provide information about geothermal
  resources located primarily within the United States (although information from
  other parts of the world is also included.  The catalog, which is funded by the
  DOE Geothermal Technology Office, is designed to accelerate the development of U.S.
  geothermal resources, and can be used to determine geothermal potential, guide exploration
  and development, make data-driven policy decisions, minimize development risks,
  \ understand how geothermal activities affect your community and the environment,
  and guide investments.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
